                <tr class="total-row"><td><strong>TOTAL USER PAYS</strong></td><td class="amount-cell"><strong>SSP ${((parseFloat(e.amount)||0)+(parseFloat(e.agentCommission)||0)+(parseFloat(e.companyCommission)||0)).toFixed(2)}</strong></td></tr>
